# Amharic Gemination Mappings.
#
# This file is prepared to support transliteration systems that accomodate
# gemination (or doubling) to the target writing system. Geminated words
# are marked with the "Tebek" symbol which must be processed by the
# respective transliteration system.
#
# For simplicity of term management, this file should *only* contain Amharic
# language words. Gemination mappings in other languages should likewise be
# maintained in language specific files.
#
# The word list is derived from the following primary sources:
#
# (1) Solomon Gebre Christos, "List of Ethiopian Authors",
#     Haile Selassie I University Library, Addis Ababa, 1971.
#
# (2) አማርኛ-እንግሊዝኛ መዝገበ ቃላት, አማርኛ-እንግሊዝኛ መዝገበ ቃላት,
#     Addis Ababa, Kuraz Publishing Agency 1979 ዓ/ም [1986/1987]
#
# (3) ሐዲስ ዓለማየሁ, ፍቅር እስከ መቃብር : (ልብ ወለድ ታሪክ),
#     Berhanena Selam Matemiya Beit, Addis Ababa, 1958 ዓ/ም [1965/1966]
